import React from "react";
import "./App.css";
import UsersTable from "./UsersTable";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Jesus Lorca Luque</p>
        <UsersTable />
      </header>
    </div>
  );
}

export default App;
